window.bookSummaryJSON = "<p><b>The showdown has begun...</b></p> <p>As the cosmos reels, the precarious balance of BuyMort is on the brink of collapse. The Sleem have fallen, leaving a power vacuum that echoes across the multiverse. New threats loom as the Church initiates a desperate crusade, not just for dominance but for survival.</p> <p>Facing them? Tyson Dawes, the Windowpuncher, Warlord of Nu-Earth, and CEO of Silken Sands. Meeting the relics of the Church with relics of his own, tricking, baiting, and battling the tremendous power of the Beholders, some say he has gone too far. With his newly claimed territories in the Sleem system, Tyson brokers power with a mastery that reshapes destinies. Yet, as his influence grows, so does the scrutiny and the envy of the multiverse's darkest corners.</p> <p>With BlueCleave at his side, Tyson must face the most powerful entities in the universe while maintaining a good public image to an increasingly hostile consumer base.</p> <p>Does he have the morties, will, and talent required to survive?</p>"; 
